import React from "react";

const Main = () => {
  return (
    <>
      <div className="Main-page">
        <div>
          <h1>Профессиональный инструктор по вождению</h1>
          <button>Пройти тест онлайн</button>
        </div>
      </div>
      <div className="main-biography">
           <h2>Омурбеков Руслан Жакшылыкович- Инструктор по вождению</h2>
           <div>
               <p>Водительский стаж более 25 лет.</p>
               <p>Индивидуально подготовил к практическому вождению более 1500 студентов</p>
               <p>Опыт преподавания и инструкторский стаж более 12 лет.</p>
               <p>За 6 лет преподавания в автошколе выпустил более 1600 студентов</p>

               <button className="btn"></button>
           </div>
           <div>
              
           </div>
        </div>
    </>
  );
};

export default Main;
